import { Row } from 'antd';
import React, { useEffect, useRef } from 'react';
import { API_KEY } from '../../constants/api-keys';
import LazyLoadImg from '../LazyLoad/LazyLoadImg';

function ListViewTest({ imagepath }) {
	const imgRef = useRef();
	const img = imgRef.current;
	const image = API_KEY.IMAGE_URL + imagepath.poster_path;

	return (
		<Row>
			<LazyLoadImg url={image} />

			{/* {current?.map((movie) => (
			))} */}
		</Row>
	);
}

export default ListViewTest;
